import { useCallback, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Register.css";
import React from 'react';

const initFromValue = {
  name:"",
  email:"",
  password:"",
  confirmPassword:"",
};

const Register = () => {
  const navigate = useNavigate();

  const onDecorContainerClick = useCallback(() => {
    navigate("/login");
  }, [navigate]);

  const onLogoContainerClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onButtClick = useCallback(() => {
    navigate("/login");
  }, [navigate]);

  const [formValue, setFromValue] = useState(initFromValue);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFromValue({
      ...formValue,
      [name]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission or any other necessary action
    // For example, collect form data and process it
    console.log("Form values:", formValue);
    navigate("/"); // Redirect to the homepage after successful registration
  };

  return (
    <div className="register">
      <div className="decor3" onClick={onDecorContainerClick}>
        <img className="image-9-icon3" alt="" src="/image-91@2x.png" />
        <img className="image-10-icon3" alt="" src="/image-10@2x.png" />
      </div>
      <div className="logo4" onClick={onLogoContainerClick}>
        <div className="kidtube5">Kidtube</div>
        <img className="logo-child1" alt="" src="/group-2444.svg" />
      </div>
      <div className="reg">
        <div className="name2">
          <input
            className="what-is-your"
            placeholder="What is your kid’s name ?"
            type="text"
            name="name"
            value={formValue.name}
            onChange={handleInputChange}
          />
        </div>
        <div className="email2">
          <input
            className="lets-us-know"
            placeholder="Let’s us know your email ^_^"
            type="email"
            name="email"
            value={formValue.email}
            onChange={handleInputChange}
          />
        </div>
        <div className="password1">
          <input
            className="pass2"
            placeholder="Type your password here ..."
            type="password"
            name="password"
            value={formValue.password}
            onChange={handleInputChange}
          />
        </div>
        <div className="confirm">
          <input
            className="and-confirm-it"
            placeholder="... And confirm it !"
            type="password"
            name="confirmPassword"
            value={formValue.confirmPassword}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit" className="butt1" /*onClick={onButtClick}*/>
          <div className="button7">Start!</div>
        </button>
      </div>
    </div>
  );
};

export default Register;
